import { useEffect, useState } from'react';
import { BookPreview } from './BookPreview/BookPreview';
import { getBooks } from './utils';
import { AppHeader, BooksContainer } from './App.style';

import './App.css';

function App() {
  const [books, setBooks] = useState([]);

    useEffect(() => {
        getBooks()
            .then(data => {
                setBooks(data)
            })
    }, []);

  return (
    <div className="App">
      <AppHeader>
        Book Store
      </AppHeader>
      <BooksContainer>
        {books?.map((book) => (<BookPreview book={book}/>))}
      </BooksContainer>
    </div>
  );
}

export default App;
